import React, { Component } from 'react';
import CardExito from './CardExito/CardExito';
import Button from '../Button/Button';
import design from './diseño.svg';
import proceso from './proceso.svg';
import ajuste from './ajuste.svg';

class Process extends Component {
    constructor(props){
        super(props);
        this.state = {

        }
    }

    render (){

    const diseño = 'Diseño';
    const entrega = 'Desarrollo';
    const disfruta = 'Ajuste';



    const disCont = 'Envianos tu idea y diseñaremos un plan que se adapte a ti';
    const entCont = 'Desarrollamos tu producto y validaremos los resultados.';
    const disfCont = 'Ajusteremos acorde los resultados hasta alcanzar tus objetivos.';



    const estilo = 'center luz br4 mv3 mh3 ba b--black-10 w-20-l w-100 grow';
    return (

        <div id='proceso' className='vh-100-l flex flex-column items-center img-back2 tc'>
            <p className='fw1 f3 f1-ns lh-title mv3 pt6'>Descubre el exito</p>
            <div  className='flex justify-center-ns flex-wrap items-center w-90 center '>
                <CardExito text = {diseño}  content = {disCont} estilo = {estilo} image={design}/> 
                <CardExito text = {entrega}   content = {entCont} estilo = {estilo} image={proceso}/>
                <CardExito text = {disfruta}  content = {disfCont} estilo = {estilo} image={ajuste}/>
                <CardExito text = {entrega}   content = {entCont} estilo = {estilo} image={proceso}/>
                <CardExito text = {disfruta}  content = {disfCont} estilo = {estilo} image={ajuste}/>
            </div>

        </div>




    );

    }
    }

    export default Process;
